Loving this shot taken on the 🔴 Leica R 19mm f2.8 version 2 from a little hike yesterday. I had no intention of shooting black and white but the built-in orange filter and midday sun inspired me. I was able to set the camera’s creative style to black and white for viewing and really see what that orange filter was doing in my EVF.

Stoked on the results and really the first time I’ve done this. 

That little dot in the sky to the right is the moon. I decided to leave it. 

